INSERT INTO Reviews (ReviewID, OrderID, ReviewTime, ReviewRating, ReviewContent, StoreReplyTime, StoreReplyContent) VALUES
	('1', '10000001', '2024/03/22 12:41', '5', '餐點份量很足夠,蔬菜新鮮美味,整體很滿意!', '2024/03/22 13:46', '非常感謝您的正面評價,我們將繼續提供新鮮優質的蔬食餐點。'),
	('2', '10000002', '2024/03/26 12:23', '4', '雖然有點小貴,不過食材的確很新鮮,值回票價。', '2024/03/26 13:28', '我們重視食材的新鮮度和營養價值,因此成本會略高些,但絕對物超所值。您的支持是我們的動力!'),
	('3', '10000003', '2024/03/30 13:45', '5', '菜色選擇多樣化,適合喜歡嘗試新口味的我。', '2024/03/30 14:50', '菜色多元化是我們一直努力的目標,未來將陸續推出更多新口味餐點,敬請期待。'),
	('4', '10000004', '2024/04/01 12:59', '5', '他們的低卡低鈉餐點對於在控制體重的我很實用。', '2024/04/01 14:04', '很高興我們的低卡低鈉餐點對您有幫助,我們會繼續開發更多健康餐飲選擇。'),
	('5', '10000005', '2024/04/03 13:11', '3', '期待可以多一些全素選項,作為素食者的我會很開心。', '2024/04/03 14:16', '感謝您的寶貴建議,我們將評估是否可以增加全素餐點選項,滿足更多素食者的需求。'),
	('6', '10000006', '2024/04/07 12:19', '5', '服務生態度很好,能感受到他們的用心。', '2024/04/07 13:24', '服務是我們很重視的部分,我們將持續培訓員工,提供貼心友善的服務。'),
	('7', '10000007', '2024/04/09 13:35', '5', '環境乾淨舒適,是吃健康餐的好地方。', '2024/04/09 14:40', '謝謝您的肯定,寧靜舒適的就餐環境一直是我們努力的目標。'),
	('8', '10000008', '2024/04/14 13:07', '3', '偶爾會覺得調味稍嫌單調,希望可以改進。', '2024/04/14 14:12', '菜色的調味偏好因人而異,我們會檢討並改善,提供更多層次的滋味。'),
	('9', '10000009', '2024/04/19 12:47', '3', '外賣服務很方便,簡單就能吃到營養均衡的餐點。', '2024/04/19 13:52', '非常感謝您對我們外送服務的肯定,方便是我們一直追求的目標。'),
	('10', '10000010', '2024/04/25 13:50', '3', '建議可以推出更多一次可以吃足的主餐套餐。', '2024/04/25 14:55', '主餐套餐的需求很高,我們會評估是否可以推出更多種類和份量。'),
	('11', '10000011', '2024/04/28 13:03', '3', '餐點份量可以在保持飽足感的情況下更纖小一些。', '2024/04/28 14:08', '飽足感與份量的平衡一直是我們在調整的部分,我們會再努力改善。'),
	('12', '10000012', '2024/05/02 12:21', '5', '喜歡他們使用當季食材,吃得很安心。', '2024/05/02 13:26', '當季食材不僅營養豐富,也更環保,我們會堅持使用在地優質食材。'),
	('13', '10000030', '2024/05/03 13:29', '4', '餐點的烹調手法很不錯,就是餐盒的包裝設計稍嫌簡單。', NULL, NULL),
	('14', '10000031', '2024/05/03 14:08', '5', '前陣子為了減肥專吃你們的餐盒,現在已經瘦了10公斤,真是太感謝了!', NULL, NULL),
	('15', '10000032', '2024/05/03 14:42', '5', '會讓家人朋友推薦給你們,因為我真心覺得你們的餐盒很棒!', NULL, NULL),
