	('20', '10000037', '2024/05/03 17:38', '5', '實在太方便了!忙碌的上班日我完全不用煩惱午餐該吃什麼。', NULL, NULL),
	('21', '10000038', '2024/05/03 18:14', '3', '素食選擇有點單調,希望可以多一些創意搭配。', NULL, NULL),
	('22', '10000039', '2024/05/03 18:57', '5', '最近因為生病,一直在喝你們的健康湯品。湯品的營養很棒,喝完總是滿足又舒暢。', NULL, NULL),
	('23', '10000040', '2024/05/03 19:34', '1', '你們的餐盒蔬菜太生了一點,口感略顯難以下嚥。', NULL, NULL),
	('24', '10000041', '2024/05/03 20:08', '5', '好喜歡餐盒裡的小點心!雖然是健康餐盒,偶爾也要有一點甜頭才行。', NULL, NULL),
	('25', '10000042', '2024/05/03 20:49', '3', '餐點份量略嫌不足,建議可以多加一些主食。', NULL, NULL),
	('26', '10000043', '2024/05/03 21:23', '5', '我的朋友都看我變瘦很多,開始好奇是怎麼做到的。原來就是天天吃你們的餐盒!', NULL, NULL),
