	('30', '10000047', '2024/05/03 23:48', '5', '做為一個單親媽媽,你們的餐盒簡直是我的好幫手,省去不少備餐的麻煩。', NULL, NULL),
	('31', '10000048', '2024/05/04 00:22', '4', '個人認為菜色有些許缺乏創意,期待未來能有更多的驚喜。', NULL, NULL),
	('32', '10000049', '2024/05/06 12:27', '5', '每次打開餐盒,裡面的餐點都烹調得美味又用心。用餐氛圍立刻變好了!', NULL, NULL),
	('33', '10000050', '2024/05/06 12:38', '4', '價格稍高,但綜合餐點內容其實很超值。', '2024/05/06 13:43', '我們的定價是根據食材成本而定,但會致力提供超值的餐點內容。'),
	('34', '10000051', '2024/05/06 13:42', '4', '如果可以的話,希望能適當調高蔬菜的份量,增加飽足感。', NULL, NULL),
	('35', '10000052', '2024/05/06 14:18', '5', '實在太方便了,宅在家也能吃到這麼棒的健康餐點!你們是我的生活救星。', NULL, NULL),
	('36', '10000053', '2024/05/06 14:59', '5', '我本來對健康餐盒有點懷疑,但你們的餐點完全顛覆了我對於健康餐的既有印象!', NULL, NULL),
	('37', '10000054', '2024/05/06 15:47', '5', '好吃到讓我完全忘記這是健康餐盒!美味和營養並重,真是太棒了。', '2024/05/06 16:51', '非常感謝您的讚賞!我們的廚師團隊都致力於將營養與美味完美結合,為顧客帶來賞心悅目的用餐體驗。期待您再次光臨!'),
	('38', '10000055', '2024/05/06 16:24', '3', '不知道是不是我的錯覺,感覺最近幾次的餐點味道有些許變化。', '2024/05/06 17:28', '很抱歉最近的餐點讓您有所疑慮。我們會立即檢視流程,確保每一份餐點的品質都能維持一致水準。請多多包涵。'),
	('39', '10000056', '2024/05/06 17:48', '5', '為了體型管理一直吃你們的餐盒,效果很棒!也很高興能吃這麼美味的健康餐。', '2024/05/06 18:52', '這正是我們一直努力的目標!希望能透過美味又營養的餐點,協助大家輕鬆享有健康體態。我們會一直精進下去。'),
	('40', '10000057', '2024/05/06 18:39', '4', '餐點口感爽脆,就是吃完有點小饞,希望份量可以再多一些。', '2024/05/06 19:43', '非常感謝您的寶貴建議!我們會研究是否可以適度增加份量,使顧客享有更大的飽足感。'),
	('41', '10000058', '2024/05/06 19:23', '5', '每一道菜色都做得很不錯,很用心在調味和搭配上。', '2024/05/06 20:27', '很高興您對我們的調味和搭配手法給予肯定!我們會持續用心鍛鍊,為大家帶來更多驚喜菜色。'),
	('42', '10000059', '2024/05/06 20:07', '2', '個人覺得蔬菜的烹調手法稍嫌老套,期待有新的風格出現。', '2024/05/06 21:11', '謝謝您的意見!我們會積極研發新的蔬菜烹調風格,打造更豐富有趣的用餐體驗。'),
	('43', '10000060', '2024/05/06 20:54', '5', '太棒了!你們的餐盒讓我不用再自己計算熱量,也能吃得滿足又健康。', '2024/05/06 21:58', '您的稱讚是我們最大的動力!我們一定會繼續秉持營養與美味並重的理念,持之以恆為大家服務。'),
	('44', '10000061', '2024/05/06 21:36', '3', '包裝盒的設計看起來有些單調,建議可以多些創意使它更有質感。', '2024/05/06 22:40', '非常感謝您對包裝設計的建議!我們會積極檢討改進,期使包裝不僅實用也更添質感。'),
	('45', '10000062', '2024/05/06 22:19', '5', '好久沒吃你們的餐盒了,這次回鍋實在是令我回味無窮啊!', '2024/05/06 23:23', '真高興您終於回歸了!我們的廚師團隊期待您的再次光臨,帶來更多的驚喜滿足感。'),
	('46', '10000063', '2024/05/06 23:02', '4', '整體來說很棒,就是有時熱量標示和實際會有些微出入。', '2024/05/07 00:06', '這點我們會格外注意!營養標示的正確性對我們而言極為重要,我們會加強把關。謝謝您的寶貴意見。'),
	('47', '10000064', '2024/05/06 23:45', '5', '開始吃你們的健康餐盒後,我的生活作息和體能都變得更好了。', '2024/05/07 00:49', '很高興能為您的生活和健康做出正面的影響!我們會一如既往堅持初衷,為顧客提供優質服務。'),
	('48', '10000065', '2024/05/07 00:29', '2', '不得不說,餐點的調味實在有些過於單一,期待有多一點變化。', '2024/05/07 01:33', '非常抱歉讓您有這樣的感受。我們會積極檢討調味方式,注入更多變化和創意,使每一口都驚艷全新。'),
	('49', '10000066', '2024/05/07 01:06', '5', '你們的餐點簡單又美味,對我這種eeuser來說真是超級適合!', '2024/05/07 02:10', '您就是我們所要服務的對象!我們會貫徹簡單營養又美味的宗旨,為您持續提供最佳選擇。'),
	('50', '10000067', '2024/05/07 01:44', '3', '或許是我個人的問題,但我覺得餐點的油份可以再少一些會更健康。', '2024/05/07 02:48', '非常感謝您的寶貴建議!控制油份的份量一直是我們著力的重點,我們會再接再厲,力求做到更健康。'),
	('51', '10000068', '2024/05/07 13:23', '5', '作為一個單身狗,你們的餐盒救了我的生活,簡單方便又營養滿分。', '2024/05/07 14:27', '很高興我們的餐盒能為您的生活帶來便利與營養!作為單身食代者,我們更是會貼心為您把關。'),
	('52', '10000069', '2024/05/07 14:02', '2', '偶爾會吃到有些許雜質,希望在包裝上能再多些注意。', '2024/05/07 15:06', '真抱歉給您這樣的體驗。包裝環節的衛生把關將是我們需要加強的部分,我們會立即改進。'),
	('53', '10000070', '2024/05/07 14:52', '5', '真高興終於發現了你們!便利健康兩不誤的做法太貼心了。', '2024/05/07 15:56', '很高興您喜歡我們的服務理念!方便與健康並重才是我們的終極目標,我們會一路朝這個方向邁進。'),
	('54', '10000071', '2024/05/07 15:39', '3', '個人覺得湯品的份量太少了一些,可以再多加一些會更好。', '2024/05/07 16:43', '非常感謝您的反映!湯品的份量一直是我們被詢問的問題,我們會評估是否適度調高份量。'),
	('55', '10000072', '2024/05/07 16:24', '5', '你們的餐盒非常貼心地標示了詳細的營養成分資訊,很喜歡這樣的設計。', '2024/05/07 17:28', '營養資訊的透明度對我們極為重要,很高興這樣的設計獲得您的認同!我們會一如往常維持這樣的高標準。'),
	('56', '10000073', '2024/05/07 17:05', '4', '整體很好,就是價格對我來說略高,希望未來可以推出更多優惠方案。', '2024/05/07 18:09', '非常感謝您的反饋!我們會積極研擬更多優惠方案,使健康飲食也能經濟實惠,讓更多人能享有我們的服務。'),
	('57', '10000103', '2024/05/09 13:15', '3', '有些菜色的鹽味偏重,若能再修飾會更好。', '2024/05/09 14:20', '菜色的調味一直是我們在改進的部分,我們會再三檢視並修正。'),
	('58', '10000158', '2024/05/14 13:59', '5', '餐點的烹調手法很用心,層次感很足。', '2024/05/14 15:04', '手工烹調是我們的堅持,帶給食客最佳的用餐體驗是我們的目標。'),
	('59', '10000209', '2024/05/17 12:53', '4', '有些餐點熱量稍高,若能提供更多低熱量選擇會很好。', '2024/05/17 13:58', '減少熱量是我們的下一階段目標,我們會推出更多低熱量但營養均衡的選擇。'),
	('60', '10000243', '2024/05/21 12:32', '5', '店內的氛圍很放鬆,是舒壓用餐的好去處。', '2024/05/21 13:37', '提供放鬆舒適的環境是我們的宗旨,期待您再度蒞臨。'),
	('61', '10000307', '2024/05/26 13:26', '4', '有些菜色如能再多一些創意會更有賣點。', '2024/05/26 14:31', '創意菜色是我們要持續發揮的部分,我們會虛心檢討並創新。'),
	('62', '10000361', '2024/05/30 13:51', '5', '每道餐點都注重營養均衡,令人很放心。', '2024/05/30 14:56', '營養均衡對健康飲食至關重要,我們會貫徹這個理念。'),
	('63', '10000403', '2024/06/02 12:53', '5', '份量足夠,肉類和蔬菜的份量剛剛好,非常健康。我會繼續支持你們的!', '2024/06/02 13:58', '非常感謝您的肯定!我們的廚師非常用心烹調每一份餐盒,力求營養均衡美味。期待您再次光臨!'),
	('64', '10000404', '2024/06/02 13:27', '5', '真高興發現你們的餐盒!作為一個運動員,你們的餐點剛好滿足了我高熱量和高蛋白質的需求。期待更多創意菜色!', '2024/06/02 14:32', '很高興我們的餐點能滿足您的需求!我們的廚師正在研發更多針對運動人士的高蛋白餐點,很快就會推出新菜色,請持續關注!'),
	('65', '10000405', '2024/06/02 13:32', '3', '今天的餐盒有點失望。雞肉似乎有些乾硬,口感不太好。希望下次可以注意一下。', '2024/06/02 14:37', '非常抱歉,讓您有這樣的感受。我們會立即檢討烹調流程,避免雞肉過熟乾硬的問題再次發生。下次一定會做得更好!'),
	('66', '10000406', '2024/06/02 14:01', '5', '這是我吃過最美味的低卡餐盒。有你們的餐盒真是幫了我的減肥大忙,不用再自己費力計算熱量了。', '2024/06/02 15:06', '看到您這麼喜歡我們的低卡餐盒,我們感到無比欣慰!我們全心全意為像您這樣想要健康飲食又不失美味的顧客服務。祝您減肥順利!'),
	('67', '10000407', '2024/06/02 14:34', '5', '我是個外食族,平常上班也顧不了飲食。你們的外帶餐盒簡直是我的救星!真期待每天的menu。', '2024/06/02 15:39', '謝謝您的支持與讚賞!我們很高興能為像您這樣的上班族提供營養又便利的外食選擇。我們的廚師會持續推陳出新,為您營造豐富多元的用餐體驗!'),
	('68', '10000408', '2024/06/02 14:49', '5', '做為一個素食主義者,我非常欣賞你們提供如此豐富的純素選擇!期待你們未來可以推出更多創意素食餐點。', '2024/06/02 15:54', '非常感謝您對我們素食餐點的肯定!我們素食主廚正在研發全新的創意菜色,很快就會有更多驚喜推出。敬請期待!'),
	('69', '10000411', '2024/06/02 15:02', '4', '雖然我一開始對健康餐盒有點懷疑,但你們的餐點完全打消了我的疑慮!', '2024/06/02 16:07', '很高興我們的餐點讓您對健康餐盒有了新的認識和肯定!我們的每一份餐點都是經過用心醞釀,務求營養美味兼備。期盼未來能持續為您帶來驚喜!'),
	('70', '10000410', '2024/06/02 15:03', '2', '今天的餐點配菜好少,整個看起來有點單調乏味。', '2024/06/02 16:08', '非常抱歉今天的餐點讓您有這種感受。餐點的變化性是我們一直在努力的部分,未來一定會加強菜色的豐富度,讓每一份餐盒都悅目可口。再次感謝您的寶貴意見!'),
	('71', '10000409', '2024/06/02 15:08', '4', '剛開始吃你們的餐點,就被清爽好吃的滋味深深吸引。餐盒健康又美味,真是我理想的伙食!', '2024/06/02 16:13', '您的讚賞是我們最大的動力!我們的廚藝團隊都秉持食材天然、清爽健康的理念,為顧客烹調美味佳餚。期待您成為我們餐盒的常客!'),
	('72', '10000412', '2024/06/02 15:19', '3', '喜歡你們餐盒的湯品,不僅營養滿分,口感也很棒。不過有時會喝到一些雜質,希望可以再注意一下。', '2024/06/02 16:24', '非常感謝您對我們湯品的讚賞,我們很高興您喜歡這款湯品的口感與營養。關於雜質的問題,我們會立即檢視整個烹製流程,加強品管,避免類似情況再次發生。我們會不斷改進,為您帶來更好的用餐體驗!'),
